import OfertaBox from './components/Oferta/OfertaBox';
import PracownikBox from './components/Pracownik/PracownikBox';

const App = () => {
  return (
      <div className="container">
        {/* Treść aplikacji */}
        <OfertaBox isNew={true} />
        <OfertaBox isNew={false} />
        {/* Lista pracowników */}
        <PracownikBox
            imie="Jan"
            nazwisko="Kowalski"
            stanowisko="Inżynier"
            opis="Opis pracownika Jan Kowalski"
            zdjecie="/images/employee1.jpg"
        />
        <PracownikBox
            imie="Anna"
            nazwisko="Nowak"
            stanowisko="Księgowa"
            opis="Opis pracownika Anna Nowak"
            zdjecie="/images/employee2.jpg"
        />
        {/* Dodaj więcej pracowników tutaj */}
      </div>
  );
}

export default App;
